package com.dmitrij.doberstein.spritfuchs.dataclasses;

public class SortePreis {
	private String preisId;
	private String sorteId;
	private String sorte;
	private String preis;
	public SortePreis() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getPreisId() {
		return preisId;
	}
	public void setPreisId(String preisId) {
		this.preisId = preisId;
	}
	public String getSorteId() {
		return sorteId;
	}
	public void setSorteId(String sorteId) {
		this.sorteId = sorteId;
	}
	public String getSorte() {
		return sorte;
	}
	public void setSorte(String sorte) {
		this.sorte = sorte;
	}
	public String getPreis() {
		return preis;
	}
	public void setPreis(String preis) {
		this.preis = preis;
	}
	
}
